import React, {Component} from 'react'


class DogsList extends Component {

    render() {
        const {list} = this.props;
        const body = <ol></ol>
        for (var key in list) {
            let li = document.createElement("li");
            li.innerHTML = key;
            body.appendChild(li);
        }
       // console.log(URL);

        return (
            <div>
                {body}

            </div>
        )
    }

}

export default DogsList;
